import { makeStyles } from '@material-ui/core/styles'

const useStyles = makeStyles((theme) => ({
    background: {
        position: 'relative',
        width: '100%',
        height: '100%',
        zIndex: -1,
        '&:before': {
            content: '',
            position: 'absolute',
            width: '200%',
            height: '200%',
            top: '-50%',
            left: '-50%',
            zIndex: -1,
            backgroundColor: '#5656ef',
            transform: 'rotate(30deg)'
        }
    },
    webBlock: {
        marginTop: 40,
        width: '100%',
        height: '100%'
    },
    switchWrapper: {
        position: 'relative',
        '& > div': {
            position: 'absolute'
        }
    }
}))

export default useStyles
